import React from 'react';
//import img_logo from '../img/motionvalue_logo.png';
import img_logo from './img/motionvalue_logo.png';
import './Board.css';


const Home = () => {
    return (
        <div>
            <h1>Home</h1>            
            <img
                src={ img_logo }
                width='120'
                height='120'
                alt='testA' />          
      </div>
    );
};

export default Home;
